import {
  MdOutlineLibraryMusic,
  MdOutlineCategory,
  MdSkipPrevious,
  MdSkipNext,
} from "react-icons/md";
import { RiDonutChartLine ,RiPlayMiniFill } from "react-icons/ri";
import { IoVolumeMediumOutline, IoVolumeMuteOutline,IoVolumeHighOutline  } from "react-icons/io5";
import { FcLineChart } from "react-icons/fc";
import {
  PiMusicNotesPlus,
  PiRepeatThin,
  PiPlayCircleThin,
  PiShuffleThin,
  PiPauseCircleLight,
  PiMusicNotesSimple,
  PiArrowsDownUpFill,
  PiDotOutlineFill,
  PiRepeatOnceThin,
  PiPlaylistDuotone
} from "react-icons/pi";
import { AiOutlineStar, AiOutlineHeart } from "react-icons/ai";
import { BsArrowLeft, BsArrowRight } from "react-icons/bs";
import { BiSearch } from "react-icons/bi";
import { FiMoreHorizontal,} from "react-icons/fi";
import { VscChromeRestore,} from "react-icons/vsc";
import { LiaMicrophoneAltSolid,} from "react-icons/lia";
import { TfiAlarmClock} from "react-icons/tfi";




const icons = {
  MdOutlineLibraryMusic,
  RiDonutChartLine,
  FcLineChart,
  PiMusicNotesPlus,
  MdOutlineCategory,
  AiOutlineStar,
  BsArrowLeft,
  BsArrowRight,
  BiSearch,
  AiOutlineHeart,
  FiMoreHorizontal,
  PiRepeatThin,
  MdSkipPrevious,
  PiPlayCircleThin,
  MdSkipNext,
  PiShuffleThin,
  PiPauseCircleLight,
  PiMusicNotesSimple,
  PiArrowsDownUpFill,
  PiDotOutlineFill,
  PiRepeatOnceThin,
  PiPlaylistDuotone,
  IoVolumeMediumOutline,
  IoVolumeHighOutline,
  IoVolumeMuteOutline,
  VscChromeRestore,
  LiaMicrophoneAltSolid,
  RiPlayMiniFill,
  TfiAlarmClock
};

export default icons;
